rect.style:
fill: rgba(
  var(--color_background_r, 143),
  var(--color_background_g, 203),
  var(--color_background_b, 193),
  var(--color_background_a, 0.8)
);

path.style:
fill: var(--color_skin, rgb(240, 205, 177));
stroke: black;
stroke-width: 2.13px;

g.style:
fill-rule: evenodd;
clip-rule: evenodd;
stroke-linecap: round;
stroke-linejoin: round;
stroke-miterlimit: 1.5;
